import './App.css';
import { Carousel, Container, Image } from 'react-bootstrap';

function App() {
  return (
    <Container>
      <h1>Galeria</h1>
      <Carousel>
        <Carousel.Item>
          <Image src="image1.png" fluid/>
        </Carousel.Item>
        <Carousel.Item>
          <Image src="image2.png" fluid/>
        </Carousel.Item>
        <Carousel.Item>
          <Image src="image3.png" fluid/>
        </Carousel.Item>
      </Carousel>
    </Container>
  );
}

export default App;
